<!DOCTYPE html>
<html lang="fr">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Veux-tu √™tre ma Valentine? üíï</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            overflow: hidden;
            position: relative;
        }

        /* Photo grid - HIDDEN by default */
        .photo-grid {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: grid;
            grid-template-columns: repeat(6, 1fr);
            grid-template-rows: repeat(4, 1fr);
            gap: 10px;
            padding: 10px;
            opacity: 0;
            pointer-events: none;
            z-index: 1;
        }

        .photo-grid.visible {
            opacity: 1;
        }

        .photo-grid-item {
            position: relative;
            overflow: hidden;
            border-radius: 15px;
            opacity: 0;
        }

        .photo-grid-item img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            border-radius: 15px;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.3);
        }

        .container {
            text-align: center;
            background: white;
            padding: 60px 40px;
            border-radius: 30px;
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
            max-width: 500px;
            width: 90%;
            position: relative;
            z-index: 10;
        }

        h1 {
            color: #e91e63;
            font-size: 2.5em;
            margin-bottom: 20px;
            animation: pulse 1.5s ease-in-out infinite;
        }

        @keyframes pulse {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
        }

        .emoji-container {
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 20px;
            margin: 20px 0;
        }

        .heart, .bicep {
            font-size: 4em;
            display: inline-block;
            animation: heartbeat 1.2s ease-in-out infinite;
        }

        @keyframes heartbeat {
            0%, 100% { transform: scale(1); }
            25% { transform: scale(1.1); }
            50% { transform: scale(1); }
        }

        .button-container {
            position: relative;
            margin-top: 40px;
            height: 60px;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        button {
            padding: 15px 40px;
            font-size: 1.2em;
            border: none;
            border-radius: 50px;
            cursor: pointer;
            font-weight: bold;
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.2);
        }

        #ouiBtn {
            background: linear-gradient(135deg, #f093fb 0%, #f5576c 100%);
            color: white;
            position: absolute;
            z-index: 1;
            transition: transform 0.3s ease;
        }

        #ouiBtn:hover {
            transform: scale(1.1);
            box-shadow: 0 6px 20px rgba(245, 87, 108, 0.4);
        }

        #nonBtn {
            background: linear-gradient(135deg, #4facfe 0%, #00f2fe 100%);
            color: white;
            position: absolute;
            z-index: 2;
            transition: left 0.3s ease, top 0.3s ease;
        }

        .hidden {
            display: none !important;
        }

        .success-message {
            animation: fadeIn 0.8s ease-in;
        }

        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
        }

        .success-message h2 {
            color: #e91e63;
            font-size: 2em;
            margin-bottom: 20px;
            line-height: 1.4;
        }

        .success-message p {
            color: #666;
            font-size: 1.3em;
            margin: 15px 0;
        }

        @keyframes photoAppear {
            from {
                opacity: 0;
                transform: scale(0) rotate(0deg);
            }
            to {
                opacity: 1;
                transform: scale(1) rotate(360deg);
            }
        }

        .photo-visible {
            animation: photoAppear 1s ease-out forwards;
        }

        .confetti {
            position: fixed;
            width: 10px;
            height: 10px;
            background: #f0f;
            animation: confetti-fall 3s linear forwards;
            z-index: 100;
        }

        @keyframes confetti-fall {
            to {
                transform: translateY(100vh) rotate(360deg);
                opacity: 0;
            }
        }
    </style>
</head>

        // Create photo grid (hidden initially)
        function createPhotoGrid() {
            // Define grid positions - NOW INCLUDING BOTTOM RIGHT (row 3-4, col 5-6)
            const gridPositions = [
                // Row 1 (all 6 columns)
                {row: 1, col: 1}, {row: 1, col: 2}, {row: 1, col: 3}, {row: 1, col: 4}, {row: 1, col: 5}, {row: 1, col: 6},
                // Row 2 (skip center cols 3-4)
                {row: 2, col: 1}, {row: 2, col: 2}, {row: 2, col: 5}, {row: 2, col: 6},
                // Row 3 (skip center cols 3-4, but ADD col 5-6)
                {row: 3, col: 1}, {row: 3, col: 2}, {row: 3, col: 5}, {row: 3, col: 6},
                // Row 4 (all 6 columns)
                {row: 4, col: 1}, {row: 4, col: 2}, {row: 4, col: 3}, {row: 4, col: 4}, {row: 4, col: 5}, {row: 4, col: 6}
            ];

            photos.forEach((photoData, index) => {
                if (index < gridPositions.length) {
                    const div = document.createElement('div');
                    div.className = 'photo-grid-item';
                    div.style.gridRow = gridPositions[index].row;
                    div.style.gridColumn = gridPositions[index].col;
                    
                    const img = document.createElement('img');
                    img.src = photoData;
                    
                    div.appendChild(img);
                    photoGrid.appendChild(div);
                }
            });
        }

        // Create grid on load (but keep it hidden)
        createPhotoGrid();

        // Function to move the Non button away from cursor - ORIGINAL WORKING VERSION
        function moveButton(e) {
            const btnRect = nonBtn.getBoundingClientRect();
            const btnCenterX = btnRect.left + btnRect.width / 2;
            const btnCenterY = btnRect.top + btnRect.height / 2;
            
            const mouseX = e.clientX;
            const mouseY = e.clientY;
            
            // Calculate distance between cursor and button center
            const distanceX = mouseX - btnCenterX;
            const distanceY = mouseY - btnCenterY;
            const distance = Math.sqrt(distanceX * distanceX + distanceY * distanceY);
            
            // If cursor is within 150px of the button, move it away
            if (distance < 150) {
                // Calculate direction to move away from cursor
                const angle = Math.atan2(distanceY, distanceX);
                const moveDistance = 150;
                
                const newX = btnCenterX - Math.cos(angle) * moveDistance;
                const newY = btnCenterY - Math.sin(angle) * moveDistance;
                
                // Keep button within viewport bounds
                const maxX = window.innerWidth - btnRect.width;
                const maxY = window.innerHeight - btnRect.height;
                
                const boundedX = Math.max(0, Math.min(newX - btnRect.width / 2, maxX));
                const boundedY = Math.max(0, Math.min(newY - btnRect.height / 2, maxY));
                
                nonBtn.style.position = 'fixed';
                nonBtn.style.left = boundedX + 'px';
                nonBtn.style.top = boundedY + 'px';
            }
        }

        document.addEventListener('mousemove', moveButton);

        // Handle Oui button click
        ouiBtn.addEventListener('click', () => {
            document.removeEventListener('mousemove', moveButton);
            
            question.classList.add('hidden');
            successMessage.classList.remove('hidden');
            
            createConfetti();
            
            // Show photo grid
            photoGrid.classList.add('visible');
            
            // Animate all photos with staggered timing
            setTimeout(() => {
                const photoItems = document.querySelectorAll('.photo-grid-item');
                photoItems.forEach((item, index) => {
                    setTimeout(() => {
                        item.classList.add('photo-visible');
                    }, index * 100);
                });
            }, 300);
        });

        // Confetti animation
        function createConfetti() {
            const colors = ['#ff0000', '#00ff00', '#0000ff', '#ffff00', '#ff00ff', '#00ffff', '#ffa500', '#ff69b4'];
            const confettiCount = 50;
            
            for (let i = 0; i < confettiCount; i++) {
                setTimeout(() => {
                    const confetti = document.createElement('div');
                    confetti.classList.add('confetti');
                    confetti.style.left = Math.random() * 100 + '%';
                    confetti.style.background = colors[Math.floor(Math.random() * colors.length)];
                    confetti.style.animationDelay = Math.random() * 2 + 's';
                    document.body.appendChild(confetti);
                    
                    setTimeout(() => confetti.remove(), 3000);
                }, i * 50);
            }
        }
    </script>
